import{ BrowserRouter as Routes, Route} from 'react-router-dom'
import { Main } from './main/Main';
import './App.css';

function App() {
  return (

    <div className="App">
    <Routes>
        <Route path="/"
         element={<Main/>}>
        </Route>
        </Routes> 
    </div>

  );
}

export default App;
